import React from "react";
import Slotm from "./Slotm";
import App from "./App";
import Sorce from './Sorce';

const Matching = () => {
    return (
        <>
          <div>
            <h1>
              {props.x}
              {props.y}
              {props.z}
            </h1>
            <h1>this is Matching</h1>
            <hr />
          </div>
        </>
      );
};
export default Matching;
